        <Hr></Hr>
        <Ul>
          <Li>
            <Link to="#">
              <Requests>문의하기</Requests>
            </Link>
          </Li>
          <Li>
            <Link to="/qna">
              <Qna>Q&A</Qna>
            </Link>
          </Li>
          <Li>
            <Link to="/notices">
              <Notices>공지사항</Notices>
            </Link>
          </Li>
        </Ul>
      </Menubar>
    </Container>
  );
};

